@musicz4 in some scenes by using a bitrate of 400 kbps the video quality is very bad. I created my last videos by increasing this parameter to 450 and the quality improved without increasing the file size too much. Check my last videos!

These are the new options: 

-f mp4 -b:v 450k -s 352x240 -r 25 -aspect 16:9 -vcodec libx264 -b:a 56k -acodec aac -movflags faststart
